import HomeNavbar from "../../../components/HomeNavbar/HomeNavbar";

import Footer from "../../../components/Footer/Footer";

import { writing,business,humanities,Science } from "../../../data/assingmentdata"; 

const AcademicSubjects = () => {
  return (
    <div className="academic-subject">
      <HomeNavbar />
      <p className="empty"></p>
      <p className="medium-header">SUBJECTS PROFICIENCY</p>
      <div className="container">
        <p className="decription">
          My team and I, have an accumulative experience in the subjects listed
          below. We are guaranteeing you that your assignment is on safe hands.
          Your grades will speak volume. In case you do not get a satisfying
          result, we will refund your money in full...Yes, we are that confident
          that we wont disappoint you!
        </p>
        <div className="grid">
          <p className="card-headers">WRITING</p>
           { writing.map((subject)=>(
            <p key={subject.title}>{`${subject.id}.  ${subject.title}`}</p>
           )) }
           { humanities.map((subject)=>(
            <p key={subject.title}>{`${subject.id}.  ${subject.title}`}</p>
           )) }
           { business.map((subject)=>(
            <p key={subject.title}>{`${subject.id}.  ${subject.title}`}</p>
           )) }
           { Science.map((subject)=>(
            <p key={subject.title}>{`${subject.id}.  ${subject.title}`}</p>
           )) }
        </div>
      </div>
      <Footer/>
    </div>
  );
};

export default AcademicSubjects;
